import styled from "styled-components";
import React from "react";
import ReactDOM from "react-dom";

function Company(props) {
  const { company } = props;
  return (
    <div>
      <img src={company.img} />
      <h2>{company.name}</h2>
    </div>
  );
}

export default Company;
